import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom'; // Import Link
import { Container, Typography, Card, CardContent, Button, Select, MenuItem, FormControl, InputLabel, Grid, IconButton } from '@mui/material'; // Add all needed Material UI imports
import { List, ListItem, ListItemText } from '@mui/material'; // Add this line for List, ListItem, and ListItemText
import MenuIcon from '@mui/icons-material/Menu';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';
import GroupIcon from '@mui/icons-material/Group';
import GroupAddIcon from '@mui/icons-material/GroupAdd';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import RuleIcon from '@mui/icons-material/Rule';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import SecurityIcon from '@mui/icons-material/Security';
import AssignmentIcon from '@mui/icons-material/Assignment';
import FooterMenu from '../Footer.jsx'; // Import FooterMenu component
import './Team.css'; // Import the CSS file

const Team = () => {
  const navigate = useNavigate(); // Hook to navigate between pages
  const [teamData, setTeamData] = useState({
    registeredMembers: 0,
    validMembers: 0,
    teamIncome: 0.00,
    cumulativeTeamSize: 0,
    generations: [
      {
        percentage: 18,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 6,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 3,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
    ],
  });

  const [filter, setFilter] = useState('All');
  const [menuOpen, setMenuOpen] = useState(false);

  const handleFilterChange = (event) => {
    setFilter(event.target.value);
  };

  const handleViewTeamList = () => {
    navigate('/team-list');
  };

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const logout = () => {
    // Implement logout functionality here
  };

  return (
    <div className="general-container">
      <div className={`general-content ${menuOpen ? 'expanded' : ''}`}>
        <div className="square-container"> {/* Added square-container here */}
          {/* Header with Burger Icon and Logout Button */}
          <div className="header">
            <div className="header-left">
              <IconButton onClick={toggleMenu}>
                <MenuIcon />
              </IconButton>
            </div>
            <div className="header-right">
              <button className="logout-btn" onClick={logout}>
                <ExitToAppIcon />
                Logout
              </button>
            </div>
          </div>

          {/* Side Menu */}
          <div className={`side-menu ${menuOpen ? 'open' : ''}`}>
            <List>
              <ListItem button component={Link} to="/company-profile" className="menu-item">
                <AccountCircleIcon className="menu-icon" />
                <ListItemText primary="Company Profile" />
              </ListItem>
              <ListItem button component={Link} to="/platform-rules" className="menu-item">
                <RuleIcon className="menu-icon" />
                <ListItemText primary="Platform Rules" />
              </ListItem>
              <ListItem button component={Link} to="/common-problems" className="menu-item">
                <HelpOutlineIcon className="menu-icon" />
                <ListItemText primary="Common Problems" />
              </ListItem>
              <ListItem button component={Link} to="/security-center" className="menu-item">
                <SecurityIcon className="menu-icon" />
                <ListItemText primary="Security Center" />
              </ListItem>
              <ListItem button component={Link} to="/funding-details" className="menu-item">
                <AccountBalanceWalletIcon className="menu-icon" />
                <ListItemText primary="Funding Details" />
              </ListItem>
              <ListItem button component={Link} to="/invite-friends" className="menu-item">
                <GroupAddIcon className="menu-icon" />
                <ListItemText primary="Invite Friends" />
              </ListItem>
              <ListItem button component={Link} to="/my-team" className="menu-item">
                <GroupIcon className="menu-icon" />
                <ListItemText primary="My Team" />
              </ListItem>
              <ListItem button component={Link} to="/quotation-tutorial" className="menu-item">
                <AssignmentIcon className="menu-icon" />
                <ListItemText primary="Quotation Tutorial" />
              </ListItem>
            </List>
          </div>

          {/* Main Content */}
          <Container maxWidth="lg" className="page-content">
            <Typography variant="h4" className="page-title" style={{ marginTop: '-20px' }}>
              My Team
            </Typography>
            {/* Filter Section */}
            <Grid container spacing={2} justifyContent="space-between" className="filter-section" style={{ marginBottom: '60px' }}>
              <Grid item xs={12} sm={6} md={4}>
                <Typography variant="h5" className="overview-title">My Team Overview</Typography>
              </Grid>
              <Grid item xs={12} sm={6} md={4}>
                <FormControl fullWidth variant="outlined">
                  <InputLabel>Filter</InputLabel>
                  <Select value={filter} onChange={handleFilterChange} label="Filter">
                    <MenuItem value="All">All</MenuItem>
                    <MenuItem value="Last 3 Days">Last 3 Days</MenuItem>
                    <MenuItem value="This Week">This Week</MenuItem>
                    <MenuItem value="This Month">This Month</MenuItem>
                    <MenuItem value="Cancel">Cancel</MenuItem>
                  </Select>
                </FormControl>
              </Grid>
            </Grid>

            {/* Team Data Overview */}
            <Grid container spacing={3} className="overview-grid" style={{ marginTop: '-35px' }}>
              <Grid item xs={12}>
                <Card className="overview-card">
                  <CardContent>
                    <Grid container spacing={3} justifyContent="space-between">
                      <Grid item xs={12} sm={4}>
                        <Typography variant="h6" className="overview-title">Registered Members</Typography>
                        <Typography variant="body1">{teamData.registeredMembers}</Typography>
                      </Grid>
                      <Grid item xs={12} sm={4}>
                        <Typography variant="h6" className="overview-title">Valid Members</Typography>
                        <Typography variant="body1">{teamData.validMembers}</Typography>
                      </Grid>
                      <Grid item xs={12} sm={4}>
                        <Typography variant="h6" className="overview-title">Team Income</Typography>
                        <Typography variant="body1">${teamData.teamIncome.toFixed(2)}</Typography>
                      </Grid>
                    </Grid>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>
          </Container>
        </div>
      </div>
      {/* Footer */}
      <FooterMenu />
    </div>
  );
};

export default Team;
